CREATE DATABASE proyectoWebBK;
USE proyectoWebBK;

CREATE TABLE `atractivos` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `nombre` varchar(255),
  `descripcion` TEXT default NULL,
  `imagen` int default NULL,
  `video` int default NULL,
  `precio` int default NULL,
  `tipoTurista` int default NULL,
  `tipoActividad` int default NULL,
  `categoria` int default NULL,
  `idRuta` int default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;



CREATE TABLE `rutas` (
  `id` int NOT NULL auto_increment,
  `nombre` varchar(255),
  `imagen` int default NULL,
  `precio` int default NULL,
  `tipoTurista` int default NULL,
  `tipoActividad` int default NULL,
  `latitud` varchar(30) default NULL,
  `longitud` varchar(30) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;



CREATE TABLE `ruta_atractivos` (
  `id` int NOT NULL auto_increment,
  `idRuta` int,
  `idAtractivo` int,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;



